package com.hoau.wechat.vo;

import java.util.Date;

/** 
* @ClassName  :Contacts 
* @Description:联系人实体
* @author     :xujun cometzb@126.com	
* @date       :2014年4月24日 上午10:08:26 
*  
*/
public class Contacts {
	
	private String id;
	private int type;
	private String name;
	private String phone;
	//省市区部分
	private String pro_city_cty;
	private String detail_address;
	private Date create_time;
	private Date update_time;
	
	public Contacts() {
		// TODO Auto-generated constructor stub
	}
	

	


	public Contacts(String id, int type, String name, String phone,
			String pro_city_cty, String detail_address, Date create_time,
			Date update_time) {
		super();
		this.id = id;
		this.type = type;
		this.name = name;
		this.phone = phone;
		this.pro_city_cty = pro_city_cty;
		this.detail_address = detail_address;
		this.create_time = create_time;
		this.update_time = update_time;
	}





	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	
	public int getType() {
		return type;
	}

	public void setType(int type) {
		this.type = type;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getPhone() {
		return phone;
	}
	public void setPhone(String phone) {
		this.phone = phone;
	}
	public String getPro_city_cty() {
		return pro_city_cty;
	}
	public void setPro_city_cty(String pro_city_cty) {
		this.pro_city_cty = pro_city_cty;
	}
	public String getDetail_address() {
		return detail_address;
	}
	public void setDetail_address(String detail_address) {
		this.detail_address = detail_address;
	}
	public Date getCreate_time() {
		return create_time;
	}
	public void setCreate_time(Date create_time) {
		this.create_time = create_time;
	}
	public Date getUpdate_time() {
		return update_time;
	}
	public void setUpdate_time(Date update_time) {
		this.update_time = update_time;
	}
	
}
